import useCounter from './hooks';

const Example = () => {
  const { count, setCount } = useCounter();

  const countUp = () => {
    setCount(count + 1);
  };
  return (
    <>
      <div>Counts: {count}</div>
      <button onClick={countUp}>Count Up!</button>
    </>
  );
};

export default Example;
